import userActionsTypes from "./userActionTypes";

export const setCurrentUser = user => ({
  type: SET_CURRENT_USER,
  payload: user
});

export const googleSignInStart = () => ({
  type: userActionsTypes.GOOGLE_SIGN_IN_START
});

export const googleSignInSuccess = user => ({
  type: userActionsTypes.GOOGLE_SIGN_IN_SUCCESS,
  payload: user
});

export const googleSignInFailed = error => ({
  type: userActionsTypes.GOOGLE_SIGN_IN_FAILED,
  payload: error
});

export const emailSignInStart = emailAndPassword => ({
  type: userActionsTypes.EMAIL_SIGN_IN_START,
  payload: emailAndPassword
});

export const emailSignInSuccess = user => ({
  type: userActionsTypes.EMAIL_SIGN_IN_SUCCESS,
  payload: user
});

export const emailSignInFailed = error => ({
  type: userActionsTypes.EMAIL_SIGN_IN_FAILED,
  payload: error
});
